import React from 'react';
import { Button } from '@material-ui/core';
import styles from './DeleteUser.module.scss';

const DeleteUser = ({onRemove, onRemoveUser}) =>{
    return(
        <div className={styles.box}>
            <p>Bạn có chắc xóa user <span className={styles.user}>admin@gmail.com</span> không?</p>
            <div className={styles.row}>
                <Button onClick={() => onRemoveUser(id)} variant='contained' className={`${styles['btn-delete']} ${styles.btn}`}>Xóa</Button>
                <Button onClick={onRemove} variant='contained' className={`${styles['btn-cancel']} ${styles.btn}`}>Hủy</Button>
            </div>
        </div>
    )
}

export default DeleteUser;
